Some women’s are queued for Goddess Gauri worship and Some women Police constable in Mumbai is on duty in this Covid 19 phase. 

On the fourth day of Ganapati festival begins. Maharashtrian households  begin to day Goddess Gauri is worshipped. Gauri is a form of Parvati and also the mother of Ganapati Bappa. This is a very big Maharashtrian festival and it was observed yesterday 25th August 2020.

